import React, { Component } from "react";
import Login from "./Login";
import Main from "./Main";
import "../css/login.css";
import "../css/FormCss.css";

import axios from "../axios";
import { render } from "@testing-library/react";
import { BrowserRouter as Router, Link, Route, Switch } from "react-router-dom";

const { useState } = React;

class Loginup extends React.Component {
  state = {
    firstName: "",
    lastName: "",
    email: "",
    age: "",
  };

  newUserHadler = (e) => {
    e.preventDefault();

    axios
      .post("user/Register", this.state, {
        headers: {
          "Content-Type": "application/json",
        },
      })
      .then((x) => {
        console.log("sucses!" + x);
      });
  };

  checkGet = (e) => {
    axios.get("user/CheckGet", this.state).then((x) => {
      console.log("sucses!" + x);
    });
  };

  changeFirstName = (e) => {
    this.setState({ firstName: e.target.value });
  };

  render() {
    return (
      <div className="loginUp">
        <div className="Login">
          <form onSubmit={this.newUserHadler}>
            <label placeholder="">שם פרטי</label>
            <input
              type="text"
              className="input"
              value={this.state.firstName}
              onChange={this.changeFirstName}
            />
            <label placeholder="Adaptive Placeholder" alt="Placeholder">
              שם משפחה
            </label>
            <input type="text" className="input" />
            <label>שם משתמש</label>
            <input type="text" className="input" />
            <label>כתובת מייל</label>
            <input type="mail" className="input" />
            <label>סיסמה</label>
            <input type="char" className="input" />
            <label>אימות סיסמה</label>
            <input type="char" className="input" />
            <button type="submit" className="input SubmiSignup">
              הרשמה
            </button>
          </form>
        </div>
        <div className="signup">
          <form>
            <label for="firstname">שם פרטי</label>
            <input type="text" id="firstname" className="input" />
            <label for="mail">כתובת מייל</label>
            <input type="mail" id="mail" className="input" />
            <button
              type="submit"
              className="input SubmiSignup"
              onClick={() => this.newUserHadler(this.state.name)}
            >
              כניסה
            </button>
          </form>
        </div>
        <button onClick={this.checkGet}>click</button>
      </div>
    );
  }
}
